import React from 'react';
import styled from 'styled-components';

const EnrollLi = styled.li`
    /* border-bottom: 1px solid #ccd; */
    padding: 8px 0;
    & ul {
        display: flex;
        align-items: center;
    }
    & > ul > li {
        text-align: center;
    }

    &:nth-child(2n-1) {
        background-color: #aaf2;
    }
    &:last-child {
        border-radius: 0 0 5px 5px;
    }
`;


const EnrollNumber = styled.li`
    width: 70px;
`;

const EnrollTitle = styled.li`
    flex-grow: 1;
`;

const EnrollCreator = styled.li`
    width: 100px;
`;

const EnrollCreatedDate = styled.li`
    width: 120px;
`;

const EnrollDeadline = styled.li`
    width: 120px;
`;

const EnrollStatus = styled.li`
    width: 100px;
`;

const EnrollView = styled.li`
    width: 70px;
`;

const EnrollAccess = styled.li`
    width: 70px;
`;

const EnrollButton = styled.button`

`;

const EnrollListItem = () => {
    return (
        <EnrollLi>
            <ul>
                <EnrollNumber>#</EnrollNumber>
                <EnrollTitle>제목</EnrollTitle>
                <EnrollCreator>개설자</EnrollCreator>
                <EnrollCreatedDate>개설일</EnrollCreatedDate>
                <EnrollDeadline>마감일</EnrollDeadline>
                <EnrollStatus>상태</EnrollStatus>
                <EnrollView>조회</EnrollView>
                <EnrollAccess>
                    <EnrollButton>신청</EnrollButton>
                </EnrollAccess>
            </ul>
        </EnrollLi>
    );
};

export default EnrollListItem;
